import React from "react";
import { Link } from "react-router-dom";
import "./Sidebar.css";

export default function Sidebar() {
  return (
    <aside className="sidebar">
      <h2>StreamCast</h2>

      <nav>
        <Link to="/dashboard">Dashboard</Link>
        <Link to="/streams">Streams</Link>
      </nav>
    </aside>
  );
}
